import React, { useState } from 'react';
import './App.css';

import Signin from './components/Signin/Signin';

function App() {
  const [showSignin, setShowSignin] = useState(true);

  const switchToSignin = () => {
    setShowSignin(true);
  };

  const switchToHome = () => {
    setShowSignin(false);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>TitanEats</h1>
        <button onClick={switchToSignin}>Switch to Signin</button>
        <button onClick={switchToHome}>Switch to Home</button>
        {showSignin ? <Signin /> : <Home />}
      </header>
    </div>
  );
}

export default App;
